export enum Championship {
  // International Events
  MSI = "MSI",
  Worlds = "Worlds",
  FST = "FST",

  // Major Leagues
  LCK = "LCK",
  LPL = "LPL",
  LEC = "LEC",
  LTA = "LTA",
  LCP = "LCP",
  //ERL
  LFL = "LFL",
}
